import React from 'react';
import './App.css';
import Header from './components/pages/Header.component';
import Navbar from './components/layout/Navbar';


function App() {
  return (
    <>
      <div style={{ backgroundColor: 'tomato' }}>
        <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 1440 320"><path fill="#0099ff" fill-opacity="1" d="M0,320L80,277.3C160,235,320,149,480,122.7C640,96,800,128,960,170.7C1120,213,1280,267,1360,293.3L1440,320L1440,0L1360,0C1280,0,1120,0,960,0C800,0,640,0,480,0C320,0,160,0,80,0L0,0Z"></path>
          <Navbar />
        </svg>
        <p>Hello world</p>
        <Header />
      </div>
    </>
  );
}

export default App;
